--

CREATE FUNCTION public.delete_used_reset_tokens() RETURNS trigger
    LANGUAGE plpgsql
    AS $$BEGIN
    BEGIN
        DELETE FROM password_reset_tokens
        WHERE used = TRUE
        AND created_at < now() - interval '24 hours';
    EXCEPTION
        WHEN OTHERS THEN
            RAISE EXCEPTION 'Erro ao apagar tokens de recuperação de palavra-passe: %', SQLERRM;
    END;

    RETURN NEW;
END;$$;


