CREATE FUNCTION public.get_user_profile(username text) RETURNS json
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$DECLARE
    result json;
BEGIN
    BEGIN
        SELECT json_build_object(
            'id', profiles.id,
            'name', profiles.name,
            'created_year', extract(year FROM auth_users.created_at),
            'active_listings', (
                SELECT count(*)
                FROM product_listings
                WHERE owner_id = profiles.id
                AND listing_status = 1
            ),
            'total_sales', (
                SELECT count(*)
                FROM transactions
                WHERE seller_id = profiles.id
            ),
            'location', locations.full_address
        ) INTO result
        FROM profiles
        LEFT JOIN auth.users AS auth_users ON profiles.id = auth_users.id
        LEFT JOIN postgis.locations AS locations ON profiles.location_id = locations.id
        WHERE profiles.username = get_user_profile.username;

        RETURN result;
    EXCEPTION
        WHEN OTHERS THEN
            RAISE EXCEPTION 'Erro ao buscar o perfil do utilizador %: %', get_user_profile.username, SQLERRM;
    END;
END;$$;


ALTER FUNCTION public.get_user_profile(username text) OWNER TO postgres;

--
-- Name: get_user_proposals(uuid, integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_user_proposals(user_id uuid, fetch_limit integer, fetch_offset integer) RETURNS TABLE(proposal_id integer, title text, description text, sender_id uuid, receiver_id uuid, sender_name text, receiver_name text, listing_id integer, listing_title text, proposal_type text, proposal_status text, swap_with text, offered_price numeric, message text, offered_rent_per_day numeric, start_date date, end_date date, created_at timestamp without time zone, total_count integer)
    LANGUAGE plpgsql
    AS $$
BEGIN
  BEGIN
    RETURN QUERY
    SELECT 
        p.id AS proposal_id,
        p.title::text,
        p.description::text,
        p.sender_id,
        p.receiver_id,
        p.sender_name::text AS sender_name,
        p.receiver_name::text AS receiver_name,
        p.listing_id,
        p.listing_title::text AS listing_title,
        lt.description::text AS proposal_type,
        ps.description::text AS proposal_status,
        p.swap_with::text,
        p.offered_price,
        p.message::text,
        p.offered_rent_per_day,
        p.start_date,
        p.end_date,
        p.created_at,
        total.total_count
    FROM full_proposals p
    LEFT JOIN listing_types lt ON p.proposal_type_id = lt.id
    LEFT JOIN proposal_statuses ps ON p.proposal_status_id = ps.id
    CROSS JOIN (
        SELECT COUNT(*) AS total_count
        FROM full_proposals fp
        WHERE fp.sender_id = user_id OR fp.receiver_id = user_id
    ) total
    WHERE p.sender_id = user_id OR p.receiver_id = user_id
    ORDER BY p.id DESC
    LIMIT fetch_limit OFFSET fetch_offset;

  EXCEPTION
    WHEN OTHERS THEN
      RAISE EXCEPTION 'Erro ao buscar propostas para o utilizador %: %', user_id, SQLERRM;
  END;
END;
$$;


