--
-- Name: soft_delete_user(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.soft_delete_user(user_id text) RETURNS void
    LANGUAGE plpgsql
    AS $$DECLARE
  user_uuid UUID;
BEGIN
  BEGIN
    user_uuid := user_id::UUID;

    DELETE FROM auth.users WHERE id = user_uuid;

    UPDATE profiles
    SET is_deleted = TRUE, deleted_at = NOW()
    WHERE id = user_uuid;

    DELETE FROM blocked_users WHERE blocked_id = user_uuid OR blocker_id = user_uuid;

    DELETE FROM contacts c WHERE c.user_id = user_uuid;

    DELETE FROM favorites f WHERE f.user_id = user_uuid;

    UPDATE product_listings
    SET listing_status=(
      Select id from listing_statuses WHERE description = 'inactive'
    )
      WHERE owner_id = user_uuid;
  EXCEPTION
    WHEN OTHERS THEN
      RAISE EXCEPTION 'Erro ao eliminar utilizador %: %', user_uuid, SQLERRM;
  END;
END;$$;


ALTER FUNCTION public.soft_delete_user(user_id text) OWNER TO postgres;

