price\r\n    END\r\n  ), 0)\r\n  INTO v_sales_balance\r\n  FROM accepted_sales;\r\n\r\n  WITH accepted_rentals AS (\r\n    SELECT \r\n      rp.offered_rent_per_day,\r\n      rp.start_date,\r\n      rp.end_date,\r\n      p.sender_id,\r\n      p.receiver_id,\r\n      rl.owner_id,\r\n      DATE_PART('day', rp.end_date - rp.start_date) AS rental_days\r\n    FROM rental_proposals rp\r\n    JOIN proposals p ON rp.id = p.id\r\n    JOIN rental_listings rl ON p.listing_id = rl.id\r\n    JOIN proposal_statuses ps ON p.proposal_status_id = ps.id\r\n    WHERE ps.description = 'accepted'\r\n      AND (v_user_id = p.sender_id OR v_user_id = p.receiver_id)\r\n  )\r\n  SELECT COALESCE(SUM(\r\n    CASE\r\n      WHEN v_user_id = owner_id THEN offered_rent_per_day * rental_days\r\n      ELSE -offered_rent_per_day * rental_days\r\n    END\r\n  ), 0)\r\n  INTO v_rentals_balance\r\n  FROM accepted_rentals;\r\n\r\n  v_balance := v_sales_balance + v_rentals_balance;\r\n\r\n  RETURN COALESCE(v_balance, 0);\r\n\r\nEXCEPTION\r\n  WHEN OTHERS THEN\r\n    RAISE EXCEPTION 'Erro ao calcular saldo do utilizador %: %', user_id, SQLERRM;\r\nEND;\r\n$$","ALTER FUNCTION \\"public\\".\\"calculate_user_balance\\"(\\"user_id\\" \\"text\\") OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"create_listing\\"(\\"title\\" \\"text\\", \\"description\\" \\"text\\", \\"category\\" \\"text\\", \\"listing_type\\" \\"text\\", \\"user_id\\" \\"text\\", \\"product_condition\\" \\"text\\" DEFAULT NULL::\\"text\\", \\"price\\" numeric DEFAULT NULL::numeric, \\"is_negotiable\\" boolean DEFAULT NULL::boolean, \\"deposit_required\\" boolean DEFAULT NULL::boolean, \\"deposit_value\\" numeric DEFAULT NULL::numeric, \\"cost_per_day\\" numeric DEFAULT NULL::numeric, \\"auto_close_date\\" \\"date\\" DEFAULT NULL::\\"date\\", \\"rental_duration_limit\\" integer DEFAULT NULL::integer, \\"late_fee\\" numeric DEFAULT NULL::numeric, \\"desired_item\\" \\"text\\" DEFAULT NULL::\\"text\\", \\"recipient_requirements\\" \\"text\\" DEFAULT NULL::\\"text\\") RETURNS integer\n    LANGUAGE \\"plpgsql\\"\n    AS $$DECLARE\r\n  v_user_id UUID;\r\n  v_category_id INT;\r\n  v_listing_status_id INT;\r\n  v_listing_id INT;\r\n  v_product_condition_id INT := NULL; \r\n  v_listing_type_id INT;\r\nBEGIN\r\n  v_user_id := create_listing.user_id::UUID;\r\n\r\n  SELECT pc.id INTO v_category_id\r\n  FROM public.product_categories AS pc\r\n  WHERE pc.category = create_listing.category;\r\n\r\n  IF NOT FOUND THEN\r\n    RAISE EXCEPTION 'Categoria inválida: %', create_listing.category;\r\n  END IF;\r\n\r\n  SELECT ls.id INTO v_listing_status_id\r\n  FROM public.listing_statuses AS ls\r\n  WHERE ls.description = 'active';\r\n\r\n  IF NOT FOUND THEN\r\n    RAISE EXCEPTION 'Status \\"active\\" inválido ou não encontrado.';\r\n  END IF;\r\n\r\n  IF create_listing.listing_type = 'sale' AND create_listing.product_condition IS NOT NULL THEN\r\n    SELECT pco.id INTO v_product_condition_id\r\n    FROM public.product_conditions AS pco\r\n    WHERE pco.condition = create_listing.product_condition;\r\n\r\n    IF NOT FOUND THEN\r\n      RAISE EXCEPTION 'Condição de produto inválida: %', create_listing.product_condition;\r\n    END IF;\r\n  END IF;\r\n\r\n  SELECT lt.id INTO v_listing_type_id\r\n  FROM public.listing_types AS lt\r\n  WHERE lt.description = create_listing.listing_type;\r\n\r\n  IF NOT FOUND THEN\r\n    RAISE EXCEPTION 'Tipo de anúncio inválido: %', create_listing.listing_type;\r\n  END IF;\r\n\r\n  CASE create_listing.listing_type\r\n    WHEN 'sale' THEN\r\n      INSERT INTO public.sale_listings (\r\n        title, description, owner_id, category_id, listing_status,\r\n        price, product_condition, is_negotiable, listing_type\r\n      ) VALUES (\r\n        create_listing.title, create_listing.description, v_user_id, v_category_id,\r\n        v_listing_status_id, create_listing.price, v_product_condition_id, create_listing.is_negotiable, v_listing_type_id\r\n      )\r\n      RETURNING id INTO v_listing_id;\r\n\r\n    WHEN 'rental' THEN\r\n      INSERT INTO public.rental_listings (\r\n        title, description, owner_id, category_id, listing_status,\r\n        deposit_required, deposit_value, cost_per_day,\r\n        auto_close_date, rental_duration_limit, late_fee, listing_type\r\n      ) VALUES (\r\n        create_listing.title, create_listing.description, v_user_id, v_category_id, v_listing_status_id,\r\n        create_listing.deposit_required, create_listing.deposit_value, create_listing.cost_per_day,\r\n        create_listing.auto_close_date, create_listing.rental_duration_limit, create_listing.late_fee, v_listing_type_id\r\n      )\r\n      RETURNING id INTO v_listing_id;\r\n\r\n    WHEN 'swap' THEN\r\n      INSERT INTO public.swap_listings (\r\n        title, description, owner_id, category_id, listing_status,\r\n        desired_item, listing_type\r\n      ) VALUES (\r\n        create_listing.title, create_listing.description, v_user_id, v_category_id,\r\n        v_listing_status_id, create_listing.desired_item, v_listing_type_id\r\n      )\r\n      RETURNING id INTO v_listing_id;\r\n\r\n    WHEN 'giveaway' THEN\r\n      INSERT INTO public.giveaway_listings (\r\n        title, description, owner_id, category_id, listing_status,\r\n        recipient_requirements, listing_type\r\n      ) VALUES (\r\n        create_listing.title, create_listing.description, v_user_id, v_category_id,\r\n        v_listing_status_id, create_listing.recipient_requirements, v_listing_type_id\r\n      )\r\n      RETURNING id INTO v_listing_id;\r\n\r\n    ELSE\r\n      RAISE EXCEPTION 'Tipo de anúncio inválido: %', create_listing.listing_type;\r\n  END CASE;\r\n\r\n  RETURN v_listing_id;\r\n\r\nEXCEPTION\r\n  WHEN OTHERS THEN\r\n    RAISE EXCEPTION 'Erro ao criar anúncio para utilizador %: %', create_listing.user_id, SQLERRM;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"create_listing\\"(\\"title\\" \\"text\\", \\"description\\" \\"text\\", \\"category\\" \\"text\\", \\"listing_type\\" \\"text\\", \\"user_id\\" \\"text\\", \\"product_condition\\" \\"text\\", \\"price\\" numeric, \\"is_negotiable\\" boolean, \\"deposit_required\\" boolean, \\"deposit_value\\" numeric, \\"cost_per_day\\" numeric, \\"auto_close_date\\" \\"date\\", \\"rental_duration_limit\\" integer, \\"late_fee\\" numeric, \\"desired_item\\" \\"text\\", \\"recipient_requirements\\" \\"text\\") OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"create_location_and_update_profile\\"(\\"user_id\\" \\"text\\", \\"address\\" \\"text\\", \\"latitude\\" double precision, \\"longitude\\" double precision) RETURNS \\"void\\"\n    LANGUAGE \\"plpgsql\\"\n    AS $$DECLARE\r\n  new_location_id INT;\r\n  v_user_id UUID;\r\nBEGIN\r\n  v_user_id := user_id::UUID;\r\n\r\n  INSERT INTO postgis.locations (full_address, location, lat, lon)\r\n  VALUES (\r\n    address,\r\n    postgis.st_point(longitude, latitude),\r\n    longitude,\r\n    latitude\r\n  )\r\n  ON CONFLICT (location) DO UPDATE\r\n    SET full_address = EXCLUDED.full_address\r\n  RETURNING id INTO new_location_id;\r\n\r\n  UPDATE profiles\r\n  SET location_id = new_location_id\r\n  WHERE id = v_user_id;\r\n\r\n  RAISE NOTICE 'Current user: %, Role: %', current_user, session_user;\r\n\r\nEXCEPTION\r\n  WHEN OTHERS THEN\r\n    RAISE EXCEPTION 'Erro ao atualizar localização do utilizador %: %', v_user_id, SQLERRM;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"create_location_and_update_profile\\"(\\"user_id\\" \\"text\\", \\"address\\" \\"text\\", \\"latitude\\" double precision, \\"longitude\\" double precision) OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"create_proposal\\"(\\"title\\" \\"text\\", \\"description\\" \\"text\\", \\"listing_id\\" integer, \\"proposal_type\\" \\"text\\", \\"proposal_status\\" \\"text\\", \\"sender_id\\" \\"text\\", \\"receiver_id\\" \\"text\\", \\"offered_price\\" numeric DEFAULT NULL::numeric, \\"offered_rent_per_day\\" numeric DEFAULT NULL::numeric, \\"start_date\\" \\"date\\" DEFAULT NULL::\\"date\\", \\"end_date\\" \\"date\\" DEFAULT NULL::\\"date\\", \\"message\\" \\"text\\" DEFAULT NULL::\\"text\\", \\"swap_with\\" \\"text\\" DEFAULT NULL::\\"text\\") RETURNS \\"jsonb\\"\n    LANGUAGE \\"plpgsql\\"\n    AS $$DECLARE\r\n  v_sender_id UUID := sender_id::UUID;\r\n  v_receiver_id UUID := receiver_id::UUID;\r\n  v_proposal_type_id INT;\r\n  v_proposal_status_id INT;\r\n  v_new_proposal_id INT;\r\n  v_result JSONB;\r\nBEGIN\r\n  SELECT id INTO v_proposal_type_id\r\n  FROM listing_types lt\r\n  WHERE lt.description = proposal_type;\r\n\r\n  IF NOT FOUND THEN\r\n    RAISE EXCEPTION 'Tipo de proposta inválido: %', proposal_type;\r\n  END IF;\r\n\r\n  SELECT id INTO v_proposal_status_id\r\n  FROM proposal_statuses ps\r\n  WHERE ps.description = proposal_status;\r\n\r\n  IF NOT FOUND THEN\r\n    RAISE EXCEPTION 'Status de proposta inválido: %', proposal_status;\r\n  END IF;\r\n\r\n  IF proposal_type = 'sale' THEN\r\n    IF offered_price IS NULL THEN\r\n      RAISE EXCEPTION 'Propostas de venda requerem um preço oferecido.';\r\n    END IF;\r\n\r\n    INSERT INTO sale_proposals (\r\n      title, description, listing_id,\r\n      proposal_type_id, proposal_status_id,\r\n      sender_id, receiver_id,\r\n      offered_price, created_at\r\n    ) VALUES (\r\n      create_proposal.title, create_proposal.description, create_proposal.listing_id,\r\n      v_proposal_type_id, v_proposal_status_id,\r\n      v_sender_id, v_receiver_id,\r\n      create_proposal.offered_price, NOW()\r\n    )\r\n    RETURNING id INTO v_new_proposal_id;\r\n\r\n  ELSIF proposal_type = 'rental' THEN\r\n    IF offered_rent_per_day IS NULL OR start_date IS NULL OR end_date IS NULL THEN\r\n      RAISE EXCEPTION 'Propostas de aluguer requerem rentabilidade por dia, data de início e data de fim.';\r\n    END IF;\r\n\r\n    INSERT INTO rental_proposals (\r\n      title, description, listing_id,\r\n      proposal_type_id, proposal_status_id,\r\n      sender_id, receiver_id,\r\n      offered_rent_per_day, start_date, end_date, created_at\r\n    ) VALUES (\r\n      create_proposal.title, create_proposal.description, create_proposal.listing_id,\r\n      v_proposal_type_id, v_proposal_status_id,\r\n      v_sender_id, v_receiver_id,\r\n      create_proposal.offered_rent_per_day, create_proposal.start_date, create_proposal.end_date, NOW()\r\n    )\r\n    RETURNING id INTO v_new_proposal_id;\r\n\r\n  ELSIF proposal_type = 'swap' THEN\r\n    IF swap_with IS NULL THEN\r\n      RAISE EXCEPTION 'Propostas de troca requerem o campo swap_with.';\r\n    END IF;\r\n\r\n    INSERT INTO swap_proposals (\r\n      title, description, listing_id,\r\n      proposal_type_id, proposal_status_id,\r\n      sender_id, receiver_id,\r\n      swap_with, created_at\r\n    )\r\n    VALUES (\r\n     create_proposal.title, create_proposal.description, create_proposal.listing_id,\r\n      v_proposal_type_id, v_proposal_status_id,\r\n      v_sender_id, v_receiver_id,\r\n      create_proposal.swap_with, NOW()\r\n    )\r\n    RETURNING id INTO v_new_proposal_id;\r\n\r\n  ELSIF proposal_type = 'giveaway' THEN\r\n    IF message IS NULL THEN\r\n      RAISE EXCEPTION 'Propostas de doação requerem uma mensagem.';\r\n    END IF;\r\n\r\n    INSERT INTO giveaway_proposals (\r\n      title, description, listing_id,\r\n      proposal_type_id, proposal_status_id,\r\n      sender_id, receiver_id,\r\n      message, created_at\r\n    )\r\n    VALUES (\r\n     create_proposal.title, create_proposal.description, create_proposal.listing_id,\r\n      v_proposal_type_id, v_proposal_status_id,\r\n      v_sender_id, v_receiver_id,\r\n      create_proposal.message, NOW()\r\n    )\r\n    RETURNING id INTO v_new_proposal_id;\r\n\r\n  ELSE\r\n    RAISE EXCEPTION 'Tipo de proposta não suportado: %', proposal_type;\r\n  END IF;\r\n\r\n  SELECT JSONB_BUILD_OBJECT(\r\n    'id', p.id,\r\n    'title', p.title,\r\n    'description', p.description\r\n  )\r\n  INTO v_result\r\n  FROM proposals p\r\n  WHERE p.id = v_new_proposal_id;\r\n\r\n  RETURN v_result;\r\n\r\nEXCEPTION\r\n  WHEN OTHERS THEN\r\n    RAISE EXCEPTION 'Erro ao criar proposta: %', SQLERRM;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"create_proposal\\"(\\"title\\" \\"text\\", \\"description\\" \\"text\\", \\"listing_id\\" integer, \\"proposal_type\\" \\"text\\", \\"proposal_status\\" \\"text\\", \\"sender_id\\" \\"text\\", \\"receiver_id\\" \\"text\\", \\"offered_price\\" numeric, \\"offered_rent_per_day\\" numeric, \\"start_date\\" \\"date\\", \\"end_date\\" \\"date\\", \\"message\\" \\"text\\", \\"swap_with\\" \\"text\\") OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"delete_used_reset_tokens\\"() RETURNS \\"trigger\\"\n    LANGUAGE \\"plpgsql\\"\n    AS $$BEGIN\r\n    BEGIN\r\n        DELETE FROM password_reset_tokens\r\n        WHERE used = TRUE\r\n        AND created_at < now() - interval '24 hours';\r\n    EXCEPTION\r\n        WHEN OTHERS THEN\r\n            RAISE EXCEPTION 'Erro ao apagar tokens de recuperação de palavra-passe: %', SQLERRM;\r\n    END;\r\n\r\n    RETURN NEW;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"delete_used_reset_tokens\\"() OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"fetch_favorites\\"(\\"user_id\\" \\"uuid\\") RETURNS TABLE(\\"id\\" integer, \\"title\\" \\"text\\")\n    LANGUAGE \\"plpgsql\\"\n    AS $$\r\nBEGIN\r\n  BEGIN\r\n    RETURN QUERY\r\n    SELECT\r\n      pl.id AS id,\r\n      pl.title AS title\r\n    FROM\r\n      favorites f\r\n    JOIN\r\n      full_product_listings pl ON f.listing_id = pl.id\r\n    WHERE\r\n      f.user_id = user_id;\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao buscar os favoritos do utilizador %: %', user_id, SQLERRM;\r\n  END;\r\nEND;\r\n$$","ALTER FUNCTION \\"public\\".\\"fetch_favorites\\"(\\"user_id\\" \\"uuid\\") OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"fetch_filtered_proposals\\"(\\"user_id\\" \\"uuid\\", \\"fetch_limit\\" integer, \\"fetch_page\\" integer, \\"received\\" boolean DEFAULT false, \\"sent\\" boolean DEFAULT false, \\"accepted\\" boolean DEFAULT false, \\"rejected\\" boolean DEFAULT false, \\"cancelled\\" boolean DEFAULT false, \\"pending\\" boolean DEFAULT false) RETURNS TABLE(\\"proposal_id\\" integer, \\"title\\" \\"text\\", \\"description\\" \\"text\\", \\"sender_id\\" \\"uuid\\", \\"receiver_id\\" \\"uuid\\", \\"listing_id\\" integer, \\"listing_title\\" \\"text\\", \\"sender_name\\" \\"text\\", \\"receiver_name\\" \\"text\\", \\"proposal_type\\" \\"text\\", \\"proposal_status\\" \\"text\\", \\"created_at\\" timestamp without time zone, \\"swap_with\\" \\"text\\", \\"offered_price\\" numeric, \\"message\\" \\"text\\", \\"offered_rent_per_day\\" numeric, \\"start_date\\" timestamp without time zone, \\"end_date\\" timestamp without time zone, \\"total_count\\" bigint)\n    LANGUAGE \\"plpgsql\\"\n    AS $$\r\nBEGIN\r\n  BEGIN\r\n    RETURN QUERY\r\n    WITH base_filtered AS (\r\n      SELECT *\r\n      FROM full_proposals fp\r\n      WHERE\r\n        (\r\n          (NOT received AND NOT sent) OR\r\n          (received AND fp.receiver_id = user_id) OR\r\n          (sent AND fp.sender_id = user_id)\r\n        )\r\n        AND (\r\n          (NOT accepted AND NOT rejected AND NOT cancelled AND NOT pending) OR\r\n          (accepted AND fp.proposal_status = 'accepted') OR\r\n          (rejected AND fp.proposal_status = 'rejected') OR\r\n          (cancelled AND fp.proposal_status = 'cancelled') OR\r\n          (pending AND fp.proposal_status = 'pending')\r\n        )\r\n    ),\r\n    total_count_cte AS (\r\n      SELECT COUNT(*) AS total_count FROM base_filtered\r\n    )\r\n    SELECT \r\n      fp.id::integer AS proposal_id,\r\n      fp.title::text,\r\n      fp.description::text,\r\n      fp.sender_id::uuid,\r\n      fp.receiver_id::uuid,\r\n      fp.listing_id::integer,\r\n      fp.listing_title::text,\r\n      fp.sender_name::text,\r\n      fp.receiver_name::text,\r\n      fp.proposal_type::text,\r\n      fp.proposal_status::text,\r\n      fp.created_at::timestamp,\r\n      fp.swap_with::text,\r\n      fp.offered_price::numeric,\r\n      fp.message::text,\r\n      fp.offered_rent_per_day::numeric,\r\n      fp.start_date::timestamp,\r\n      fp.end_date::timestamp,\r\n      tc.total_count::bigint\r\n    FROM base_filtered fp\r\n    CROSS JOIN total_count_cte tc\r\n    ORDER BY fp.created_at DESC\r\n    OFFSET GREATEST((fetch_page - 1) * fetch_limit, 0)\r\n    LIMIT fetch_limit;\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao buscar propostas para o utilizador %: %', user_id, SQLERRM;\r\n  END;\r\nEND;\r\n$$","ALTER FUNCTION \\"public\\".\\"fetch_filtered_proposals\\"(\\"user_id\\" \\"uuid\\", \\"fetch_limit\\" integer, \\"fetch_page\\" integer, \\"received\\" boolean, \\"sent\\" boolean, \\"accepted\\" boolean, \\"rejected\\" boolean, \\"cancelled\\" boolean, \\"pending\\" boolean) OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"fetch_home_listings\\"(\\"fetch_limit\\" integer, \\"fetch_offset\\" integer, \\"listing_type\\" \\"text\\" DEFAULT NULL::\\"text\\", \\"search\\" \\"text\\" DEFAULT NULL::\\"text\\", \\"lat\\" double precision DEFAULT NULL::double precision, \\"lon\\" double precision DEFAULT NULL::double precision, \\"dist\\" double precision DEFAULT NULL::double precision) RETURNS TABLE(\\"id\\" \\"text\\", \\"title\\" \\"text\\", \\"type\\" \\"text\\", \\"price\\" \\"text\\", \\"cost_per_day\\" \\"text\\", \\"imageurl\\" \\"text\\", \\"total_pages\\" integer)\n    LANGUAGE \\"plpgsql\\"\n    AS $$BEGIN\r\n  BEGIN\r\n    RETURN QUERY\r\n      WITH total AS (\r\n        SELECT COUNT(*) AS cnt\r\n        FROM full_product_listings AS f\r\n        JOIN profiles AS p ON f.owner_id = p.id\r\n        LEFT JOIN postgis.locations AS l ON p.location_id = l.id\r\n        WHERE \r\n        f.listing_status = 1 AND\r\n          (fetch_home_listings.listing_type IS NULL OR f.listing_type = fetch_home_listings.listing_type)\r\n          AND (search IS NULL OR f.title ILIKE '%' || search || '%')\r\n          AND (\r\n            fetch_home_listings.lat IS NULL OR fetch_home_listings.lon IS NULL OR fetch_home_listings.dist IS NULL OR\r\n            (l.location IS NOT NULL AND\r\n             postgis.st_dwithin(\r\n                l.location,\r\n                postgis.st_setsrid(postgis.st_point(fetch_home_listings.lon, fetch_home_listings.lat), 4326)::postgis.geography,\r\n                fetch_home_listings.dist\r\n             )\r\n            )\r\n          )\r\n      )\r\n      SELECT \r\n        f.id::text,\r\n        f.title,\r\n        f.listing_type AS type,\r\n        f.price::text,\r\n        f.cost_per_day::text,\r\n        f.main_image_url AS imageUrl,\r\n        CEIL(total.cnt::numeric / NULLIF(fetch_limit, 0))::integer AS total_pages\r\n      FROM full_product_listings AS f\r\n      JOIN profiles AS p ON f.owner_id = p.id\r\n      LEFT JOIN postgis.locations AS l ON p.location_id = l.id\r\n      CROSS JOIN total\r\n      WHERE \r\n        f.listing_status = 1 AND\r\n        (fetch_home_listings.listing_type IS NULL OR f.listing_type = fetch_home_listings.listing_type)\r\n        AND (search IS NULL OR f.title ILIKE '%' || search || '%')\r\n        AND (\r\n            fetch_home_listings.lat IS NULL OR fetch_home_listings.lon IS NULL OR fetch_home_listings.dist IS NULL OR\r\n            (l.location IS NOT NULL AND\r\n             postgis.st_dwithin(\r\n                l.location,\r\n                postgis.st_setsrid(postgis.st_point(fetch_home_listings.lon, fetch_home_listings.lat), 4326)::postgis.geography,\r\n                fetch_home_listings.dist\r\n             )\r\n            )\r\n        )\r\n      ORDER BY f.id\r\n      LIMIT fetch_limit OFFSET fetch_offset;\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao fazer fetch de anúncios da home: %', SQLERRM;\r\n  END;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"fetch_home_listings\\"(\\"fetch_limit\\" integer, \\"fetch_offset\\" integer, \\"listing_type\\" \\"text\\", \\"search\\" \\"text\\", \\"lat\\" double precision, \\"lon\\" double precision, \\"dist\\" double precision) OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"fetch_user_listings\\"(\\"owner_id\\" \\"uuid\\", \\"fetch_limit\\" integer, \\"fetch_offset\\" integer) RETURNS TABLE(\\"id\\" \\"text\\", \\"title\\" \\"text\\", \\"type\\" \\"text\\", \\"price\\" numeric, \\"priceperday\\" numeric, \\"main_image_url\\" \\"text\\")\n    LANGUAGE \\"plpgsql\\"\n    AS $$BEGIN\r\n  BEGIN\r\n    RETURN QUERY\r\n      SELECT\r\n        f.id::text,\r\n        f.title,\r\n        f.listing_type AS type,\r\n        f.price::numeric,\r\n        f.cost_per_day::numeric AS priceperday,\r\n        f.main_image_url AS image_url\r\n      FROM full_product_listings f\r\n      WHERE f.listing_status = 1 AND\r\n      f.owner_id = fetch_user_listings.owner_id\r\n      ORDER BY f.id\r\n      LIMIT fetch_limit OFFSET fetch_offset;\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao fazer fetch dos anúncios para o utilizador %: %', owner_id, SQLERRM;\r\n  END;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"fetch_user_listings\\"(\\"owner_id\\" \\"uuid\\", \\"fetch_limit\\" integer, \\"fetch_offset\\" integer) OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"fetch_user_location\\"(\\"user_id\\" \\"uuid\\") RETURNS TABLE(\\"location_id\\" integer, \\"full_address\\" \\"text\\", \\"lat\\" double precision, \\"lon\\" double precision, \\"created_at\\" timestamp without time zone)\n    LANGUAGE \\"plpgsql\\"\n    AS $$\r\nBEGIN\r\n  BEGIN\r\n    RETURN QUERY\r\n    SELECT \r\n      l.id AS location_id,\r\n      l.full_address,\r\n      l.lat,\r\n      l.lon,\r\n      l.created_at\r\n    FROM public.profiles AS p\r\n    JOIN postgis.locations AS l ON p.location_id = l.id\r\n    WHERE p.id = user_id\r\n      AND p.is_deleted IS NOT TRUE;\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao buscar localização para o utilizador %: %', user_id, SQLERRM;\r\n  END;\r\nEND;\r\n$$","ALTER FUNCTION \\"public\\".\\"fetch_user_location\\"(\\"user_id\\" \\"uuid\\") OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"get_basic_user_info\\"(\\"user_id\\" \\"uuid\\") RETURNS TABLE(\\"id\\" \\"uuid\\", \\"username\\" \\"text\\", \\"name\\" \\"text\\", \\"location_id\\" \\"uuid\\", \\"is_deleted\\" boolean, \\"deleted_at\\" timestamp without time zone, \\"created_at\\" timestamp without time zone, \\"last_sign_in_at\\" timestamp without time zone)\n    LANGUAGE \\"plpgsql\\"\n    AS $$\r\nBEGIN\r\n  BEGIN\r\n    RETURN QUERY\r\n    SELECT \r\n        p.id,\r\n        p.username,\r\n        p.name,\r\n        p.location_id,\r\n        p.is_deleted,\r\n        p.deleted_at,\r\n        u.created_at,\r\n        u.last_sign_in_at\r\n    FROM profiles p\r\n    JOIN auth.users u ON p.id = u.id\r\n    WHERE p.id = user_id; \r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao buscar informações para o utilizador %: %', user_id, SQLERRM;\r\n  END;\r\nEND;\r\n$$","ALTER FUNCTION \\"public\\".\\"get_basic_user_info\\"(\\"user_id\\" \\"uuid\\") OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"get_listing_json\\"(\\"listing_id\\" integer) RETURNS \\"jsonb\\"\n    LANGUAGE \\"plpgsql\\"\n    AS $$DECLARE\r\n  result JSONB;\r\nBEGIN\r\n  BEGIN\r\n    SELECT jsonb_strip_nulls(jsonb_build_object(\r\n        'id', full_product_listings.id,\r\n        'title', full_product_listings.title,\r\n        'description', full_product_listings.description,\r\n        'date_created', full_product_listings.date_created,\r\n        'owner_id', full_product_listings.owner_id,\r\n        'owner_username', profiles.username,\r\n        'category_id', full_product_listings.category_id,\r\n        'listing_status', full_product_listings.listing_status,\r\n        'listing_type', full_product_listings.listing_type,\r\n        'deposit_required', full_product_listings.deposit_required,\r\n        'cost_per_day', full_product_listings.cost_per_day,\r\n        'auto_close_date', full_product_listings.auto_close_date,\r\n        'rental_duration_limit', full_product_listings.rental_duration_limit,\r\n        'late_fee', full_product_listings.late_fee,\r\n        'price', full_product_listings.price,\r\n        'product_condition', full_product_listings.product_condition,\r\n        'is_negotiable', full_product_listings.is_negotiable,\r\n        'desired_item', full_product_listings.desired_item,\r\n        'recipient_requirements', full_product_listings.recipient_requirements,\r\n        'image_url', full_product_listings.main_image_url\r\n    ))\r\n    INTO result\r\n    FROM full_product_listings\r\n    Left JOIN profiles on profiles.id = full_product_listings.owner_id\r\n    WHERE full_product_listings.id = listing_id; \r\n\r\n    RETURN result;\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao buscar informações para o anúncio de ID %: %', listing_id, SQLERRM;\r\n  END;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"get_listing_json\\"(\\"listing_id\\" integer) OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"get_proposal_json\\"(\\"proposal_id\\" integer) RETURNS \\"jsonb\\"\n    LANGUAGE \\"plpgsql\\"\n    AS $$DECLARE\r\n  result JSONB;\r\nBEGIN\r\n  BEGIN\r\n    SELECT\r\n      jsonb_strip_nulls(\r\n        jsonb_build_object(\r\n          'proposal_id', f.id,\r\n          'title', f.title,\r\n          'description', f.description,\r\n          'created_at', f.created_at,\r\n          'sender_id', f.sender_id,\r\n          'receiver_id', f.receiver_id,\r\n          'listing_id', f.listing_id,\r\n          'listing_title', f.listing_title,\r\n          'sender_name', f.sender_name,\r\n          'sender_username', f.sender_username,\r\n          'receiver_name', f.receiver_name,\r\n          'receiver_username', f.receiver_username,\r\n          'proposal_type', f.proposal_type,\r\n          'proposal_status_id', f.proposal_status_id,\r\n          'proposal_status', proposal_statuses.description,\r\n          'offered_price', f.offered_price,\r\n          'swap_with', f.swap_with,\r\n          'message', f.message,\r\n          'offered_rent_per_day', f.offered_rent_per_day,\r\n          'start_date', f.start_date,\r\n          'end_date', f.end_date\r\n        )\r\n      )\r\n    INTO result\r\n    FROM full_proposals f\r\n    LEFT JOIN proposal_statuses ON f.proposal_status_id = proposal_statuses.id\r\n    WHERE f.id = proposal_id;  \r\n\r\n    RETURN result;\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao buscar as informações da proposta com ID %: %', proposal_id, SQLERRM;\r\n  END;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"get_proposal_json\\"(\\"proposal_id\\" integer) OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"get_user_profile\\"(\\"username\\" \\"text\\") RETURNS \\"json\\"\n    LANGUAGE \\"plpgsql\\" SECURITY DEFINER\n    AS $$DECLARE\r\n    result json;\r\nBEGIN\r\n    BEGIN\r\n        SELECT json_build_object(\r\n            'id', profiles.id,\r\n            'name', profiles.name,\r\n            'created_year', extract(year FROM auth_users.created_at),\r\n            'active_listings', (\r\n                SELECT count(*)\r\n                FROM product_listings\r\n                WHERE owner_id = profiles.id\r\n                AND listing_status = 1\r\n            ),\r\n            'total_sales', (\r\n                SELECT count(*)\r\n                FROM transactions\r\n                WHERE seller_id = profiles.id\r\n            ),\r\n            'location', locations.full_address\r\n        ) INTO result\r\n        FROM profiles\r\n        LEFT JOIN auth.users AS auth_users ON profiles.id = auth_users.id\r\n        LEFT JOIN postgis.locations AS locations ON profiles.location_id = locations.id\r\n        WHERE profiles.username = get_user_profile.username;\r\n\r\n        RETURN result;\r\n    EXCEPTION\r\n        WHEN OTHERS THEN\r\n            RAISE EXCEPTION 'Erro ao buscar o perfil do utilizador %: %', get_user_profile.username, SQLERRM;\r\n    END;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"get_user_profile\\"(\\"username\\" \\"text\\") OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"get_user_proposals\\"(\\"user_id\\" \\"uuid\\", \\"fetch_limit\\" integer, \\"fetch_offset\\" integer) RETURNS TABLE(\\"proposal_id\\" integer, \\"title\\" \\"text\\", \\"description\\" \\"text\\", \\"sender_id\\" \\"uuid\\", \\"receiver_id\\" \\"uuid\\", \\"sender_name\\" \\"text\\", \\"receiver_name\\" \\"text\\", \\"listing_id\\" integer, \\"listing_title\\" \\"text\\", \\"proposal_type\\" \\"text\\", \\"proposal_status\\" \\"text\\", \\"swap_with\\" \\"text\\", \\"offered_price\\" numeric, \\"message\\" \\"text\\", \\"offered_rent_per_day\\" numeric, \\"start_date\\" \\"date\\", \\"end_date\\" \\"date\\", \\"created_at\\" timestamp without time zone, \\"total_count\\" integer)\n    LANGUAGE \\"plpgsql\\"\n    AS $$\r\nBEGIN\r\n  BEGIN\r\n    RETURN QUERY\r\n    SELECT \r\n        p.id AS proposal_id,\r\n        p.title::text,\r\n        p.description::text,\r\n        p.sender_id,\r\n        p.receiver_id,\r\n        p.sender_name::text AS sender_name,\r\n        p.receiver_name::text AS receiver_name,\r\n        p.listing_id,\r\n        p.listing_title::text AS listing_title,\r\n        lt.description::text AS proposal_type,\r\n        ps.description::text AS proposal_status,\r\n        p.swap_with::text,\r\n        p.offered_price,\r\n        p.message::text,\r\n        p.offered_rent_per_day,\r\n        p.start_date,\r\n        p.end_date,\r\n        p.created_at,\r\n        total.total_count\r\n    FROM full_proposals p\r\n    LEFT JOIN listing_types lt ON p.proposal_type_id = lt.id\r\n    LEFT JOIN proposal_statuses ps ON p.proposal_status_id = ps.id\r\n    CROSS JOIN (\r\n        SELECT COUNT(*) AS total_count\r\n        FROM full_proposals fp\r\n        WHERE fp.sender_id = user_id OR fp.receiver_id = user_id\r\n    ) total\r\n    WHERE p.sender_id = user_id OR p.receiver_id = user_id\r\n    ORDER BY p.id DESC\r\n    LIMIT fetch_limit OFFSET fetch_offset;\r\n\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao buscar propostas para o utilizador %: %', user_id, SQLERRM;\r\n  END;\r\nEND;\r\n$$","ALTER FUNCTION \\"public\\".\\"get_user_proposals\\"(\\"user_id\\" \\"uuid\\", \\"fetch_limit\\" integer, \\"fetch_offset\\" integer) OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"handle_new_user\\"() RETURNS \\"trigger\\"\n    LANGUAGE \\"plpgsql\\" SECURITY DEFINER\n    SET \\"search_path\\" TO 'public'\n    AS $$BEGIN\r\n  BEGIN\r\n    INSERT INTO profiles (id, username, name, email) \r\n    VALUES (new.id, new.raw_user_meta_data->>'username', new.raw_user_meta_data->>'name', new.raw_user_meta_data->>'email');\r\n    RETURN new;\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao inserir perfil para o novo utilizador %: %', new.id, SQLERRM;\r\n  END;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"handle_new_user\\"() OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"health_check\\"() RETURNS boolean\n    LANGUAGE \\"plpgsql\\" SECURITY DEFINER\n    AS $$\r\nbegin\r\n  return true;\r\nend;\r\n$$","ALTER FUNCTION \\"public\\".\\"health_check\\"() OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"insert_contact\\"(\\"user_id\\" \\"text\\", \\"name\\" \\"text\\", \\"description\\" \\"text\\", \\"phone_number\\" \\"text\\") RETURNS TABLE(\\"contact_id\\" integer, \\"contact_name\\" \\"text\\", \\"contact_phone_number\\" \\"text\\", \\"contact_description\\" \\"text\\")\n    LANGUAGE \\"plpgsql\\"\n    AS $$BEGIN\r\n  BEGIN\r\n    IF (SELECT COUNT(*) FROM contacts c WHERE c.user_id = insert_contact.user_id::UUID) >= 5 THEN\r\n      RAISE EXCEPTION 'Contact limit reached for user %', user_id;\r\n    END IF;\r\n\r\n    RETURN QUERY\r\n    INSERT INTO contacts (user_id, name, description, phone_number)\r\n    VALUES (insert_contact.user_id::UUID, insert_contact.name, insert_contact.description, insert_contact.phone_number)\r\n    RETURNING contacts.id, contacts.name, contacts.phone_number, contacts.description;\r\n\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao processar o contato para o utilizador %: %', user_id, SQLERRM;\r\n  END;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"insert_contact\\"(\\"user_id\\" \\"text\\", \\"name\\" \\"text\\", \\"description\\" \\"text\\", \\"phone_number\\" \\"text\\") OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"soft_delete_user\\"(\\"user_id\\" \\"text\\") RETURNS \\"void\\"\n    LANGUAGE \\"plpgsql\\"\n    AS $$DECLARE\r\n  user_uuid UUID;\r\nBEGIN\r\n  BEGIN\r\n    user_uuid := user_id::UUID;\r\n\r\n    DELETE FROM auth.users WHERE id = user_uuid;\r\n\r\n    UPDATE profiles\r\n    SET is_deleted = TRUE, deleted_at = NOW()\r\n    WHERE id = user_uuid;\r\n\r\n    DELETE FROM blocked_users WHERE blocked_id = user_uuid OR blocker_id = user_uuid;\r\n\r\n    DELETE FROM contacts c WHERE c.user_id = user_uuid;\r\n\r\n    DELETE FROM favorites f WHERE f.user_id = user_uuid;\r\n\r\n    UPDATE product_listings\r\n    SET listing_status=(\r\n      Select id from listing_statuses WHERE description = 'inactive'\r\n    )\r\n      WHERE owner_id = user_uuid;\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao eliminar utilizador %: %', user_uuid, SQLERRM;\r\n  END;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"soft_delete_user\\"(\\"user_id\\" \\"text\\") OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"update_auth_metadata\\"(\\"new_metadata\\" \\"jsonb\\", \\"user_id\\" \\"text\\") RETURNS \\"void\\"\n    LANGUAGE \\"plpgsql\\" SECURITY DEFINER\n    AS $$DECLARE user_uuid UUID;\r\nnew_email TEXT;\r\nBEGIN\r\nuser_uuid:=user_id::UUID;\r\nnew_email := new_metadata->>'email';\r\n  UPDATE auth.users\r\n  SET raw_user_meta_data = COALESCE(raw_user_meta_data, '{}'::jsonb) || new_metadata\r\n  WHERE id = user_uuid;\r\n\r\nIF new_email IS NOT NULL AND new_email <> '' THEN\r\n    UPDATE auth.users\r\n    SET email = new_email\r\n    WHERE id = user_uuid;\r\n  END IF;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"update_auth_metadata\\"(\\"new_metadata\\" \\"jsonb\\", \\"user_id\\" \\"text\\") OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"update_listing_image_url\\"(\\"listing_id\\" integer, \\"image_url\\" \\"text\\") RETURNS \\"void\\"\n    LANGUAGE \\"plpgsql\\"\n    AS $$\r\nBEGIN\r\n  BEGIN\r\n    UPDATE public.product_listings\r\n    SET main_image_url = image_url\r\n    WHERE id = listing_id;\r\n\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao atualizar a imagem principal do produto com ID %: %', listing_id, SQLERRM;\r\n  END;\r\nEND;\r\n$$","ALTER FUNCTION \\"public\\".\\"update_listing_image_url\\"(\\"listing_id\\" integer, \\"image_url\\" \\"text\\") OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"update_proposal_status\\"(\\"proposal_id\\" integer, \\"new_status\\" \\"text\\", \\"user_id\\" \\"text\\") RETURNS boolean\n    LANGUAGE \\"plpgsql\\"\n    AS $$DECLARE\r\n  v_user_id UUID;\r\n  v_listing_id INT;\r\n  v_status_id INT;\r\n  v_receiver_id UUID;\r\n  v_sender_id UUID;\r\nBEGIN\r\n  v_user_id := user_id::UUID;\r\n\r\n  SELECT id INTO v_status_id\r\n  FROM proposal_statuses\r\n  WHERE description = new_status;\r\n\r\n  IF NOT FOUND THEN\r\n    RAISE EXCEPTION 'Status inválido: %', new_status;\r\n  END IF;\r\n\r\n  SELECT receiver_id, sender_id INTO v_receiver_id, v_sender_id\r\n  FROM proposals\r\n  WHERE id = proposal_id;\r\n\r\n  IF v_receiver_id IS NULL THEN\r\n    RAISE EXCEPTION 'Proposta não encontrada ou não tem receiver';\r\n  END IF;\r\n\r\n  IF new_status = 'cancelled' THEN\r\n    IF v_sender_id != v_user_id THEN\r\n      RAISE EXCEPTION 'Utilizador não autorizado a cancelar esta proposta';\r\n    END IF;\r\n  ELSE\r\n    IF v_receiver_id != v_user_id THEN\r\n      RAISE EXCEPTION 'Utilizador não autorizado a alterar esta proposta';\r\n    END IF;\r\n\r\n    IF new_status = 'accepted' THEN\r\n      SELECT listing_id INTO v_listing_id\r\n      FROM proposals\r\n      WHERE id = proposal_id;\r\n\r\n      UPDATE product_listings\r\n      SET listing_status=(\r\n        Select id from listing_statuses WHERE listing_statuses.id=3\r\n      )\r\n      WHERE id = v_listing_id;\r\n\r\n      UPDATE proposals\r\n      SET proposal_status_id = (\r\n        SELECT id FROM proposal_statuses WHERE description = 'rejected'\r\n      )\r\n      WHERE listing_id = v_listing_id\r\n        AND id != proposal_id;\r\n    END IF;\r\n  END IF;\r\n\r\n  UPDATE proposals\r\n  SET proposal_status_id = v_status_id\r\n  WHERE id = proposal_id;\r\n\r\n  RETURN TRUE;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"update_proposal_status\\"(\\"proposal_id\\" integer, \\"new_status\\" \\"text\\", \\"user_id\\" \\"text\\") OWNER TO \\"postgres\\"","CREATE OR REPLACE FUNCTION \\"public\\".\\"update_user_data\\"(\\"user_id\\" \\"text\\", \\"profile_data\\" \\"jsonb\\") RETURNS \\"void\\"\n    LANGUAGE \\"plpgsql\\"\n    AS $$DECLARE\r\n  v_user_id UUID;\r\n  v_email TEXT;\r\n  v_username TEXT;\r\n  v_name TEXT;\r\n  v_location_id INT;\r\n  v_user_metadata JSONB;\r\nBEGIN\r\n  v_user_id := user_id::UUID;\r\n\r\n  v_email := profile_data->>'email';  \r\n  v_username := profile_data->>'username';  \r\n  v_name := profile_data->>'name';  \r\n  v_location_id := (profile_data->>'location_id')::INT;\r\n\r\n  v_user_metadata := jsonb_build_object(\r\n        'name', v_name,\r\n        'username', v_username,\r\n        'email', v_email,\r\n        'location_id', v_location_id\r\n    );\r\n\r\n  BEGIN\r\n    PERFORM update_auth_metadata(v_user_metadata, user_id);\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao atualizar os metadados de autenticação para o utilizador %: %', v_user_id, SQLERRM;\r\n  END;\r\n\r\n  BEGIN\r\n    UPDATE public.profiles\r\n    SET \r\n      username = COALESCE(v_username, username),\r\n      name = COALESCE(v_name, name),\r\n      location_id = COALESCE(v_location_id, location_id),\r\n      email = COALESCE(v_email, email)\r\n    WHERE id = v_user_id;\r\n  EXCEPTION\r\n    WHEN OTHERS THEN\r\n      RAISE EXCEPTION 'Erro ao atualizar o perfil para o utilizador %: %', v_user_id, SQLERRM;\r\n  END;\r\nEND;$$","ALTER FUNCTION \\"public\\".\\"update_user_data\\"(\\"user_id\\" \\"text\\", \\"profile_data\\" \\"jsonb\\") OWNER TO \\"postgres\\"","SET default_tablespace = ''","SET default_table_access_method = \\"heap\\"","CREATE TABLE IF NOT EXISTS \\"postgis\\".\\"locations\\" (\n    \\"id\\" integer NOT NULL,\n    \\"full_address\\" \\"text\\" NOT NULL,\n    \\"created_at\\" timestamp without time zone DEFAULT \\"now\\"() NOT NULL,\n    \\"location\\" \\"postgis\\".\\"geography\\"(Point,4326) NOT NULL,\n    \\"lat\\" double precision NOT NULL,\n    \\"lon\\" double precision NOT NULL\n)","ALTER TABLE \\"postgis\\".\\"locations\\" OWNER TO \\"postgres\\"","CREATE SEQUENCE IF NOT EXISTS \\"postgis\\".\\"locations_id_seq\\"\n    AS integer\n    START WITH 1\n    INCREMENT BY 1\n    NO MINVALUE\n    NO MAXVALUE\n    CACHE 1","ALTER TABLE \\"postgis\\".\\"locations_id_seq\\" OWNER TO \\"postgres\\"","ALTER SEQUENCE \\"postgis\\".\\"locations_id_seq\\" OWNED BY \\"postgis\\".\\"locations\\".\\"id\\"","CREATE TABLE IF NOT EXISTS \\"public\\".\\"blocked_users\\" (\n    \\"blocker_id\\" \\"uuid\\" NOT NULL,\n    \\"blocked_id\\" \\"uuid\\" NOT NULL\n)","ALTER TABLE \\"public\\".\\"blocked_users\\" OWNER TO \\"postgres\\"","CREATE TABLE IF NOT EXISTS \\"public\\".\\"contacts\\" (\n    \\"id\\" integer NOT NULL,\n    \\"name\\" \\"text\\" NOT NULL,\n    \\"description\\" \\"text\\"